import DrawerView from './Drawer-view'
import PropTypes from 'prop-types'

const Drawer = ({ location, perspective }) => {
    return <DrawerView location={location} perspective={perspective} />
}

Drawer.propTypes = {
    location: PropTypes.string.isRequired,
    perspective: PropTypes.bool.isRequired
}

export default Drawer
